import React from "react";
import { Link } from "react-router-dom";
import curso from "../data/Pruebas";

const Nosotros = ()=>{
    return(
        <div>
            <div>
                <h1>estamos aqui</h1>
            </div>
            <ul>
                { curso.map(iten=>(
                        <li key={iten.id}>
                            <Link to ={`/Nosotros/${iten.id}`}> 
                                {iten.titulo}
                                {iten.actualizacion}
                                {iten.id}
                            </Link>
                        </li>
                    ))
                }
            </ul>
        </div>

    )

}

export default Nosotros;
